Richard L. Epstein, &quot;Critical Thinking&quot;
English | ISBN: 0534583482 | edition 2005 | PDF | 448 pages | 5,6 mb


Critical thinking isn't as easy as it sounds. CRITICAL THINKING shows you how decision-making errors are made, and how to avoid them. By combining simple explanations with time-tested theories, CRITICAL THINKING helps you meet the challenges of life head-on.
